import styled from "styled-components";

export const Footer = styled.footer`
  box-sizing: border-box;
  position: absolute;
  width: 1440px;
  height: 200px;
  left: 0px;
  top: 928px;
  background: #fafafa;
  border: 1px solid #d8d8d8;
`;
export const Smile1 = styled.div`
  position: absolute;
  height: 208px;
  width: 214px;
  left: 57.14px;
  top: 6.94px;
  background: url("./img/red_cartoon_3.png") no-repeat center top;
  transform: matrix(0.74, -0.67, 0.67, 0.74, 0, 0);
`;
export const Smile2 = styled.div`
  position: absolute;
  height: 97px;
  width: 78.46px;
  left: 1234px;
  top: 0px;
  background: url("./img/footer_smile_2.png") no-repeat center top;
`;
export const Smile3 = styled.div`
  position: absolute;
  height: 85.84px;
  width: 88.32px;
  left: 1372.67px;
  top: 68.61px;
  border-radius: 0px;
  background: url("./img/red_cartoon_4.png") no-repeat center center;
  transform: rotate(-35.19deg);
`;
export const SocialLinks = styled.div`
  position: absolute;
  width: 127px;
  height: 16.09px;
  left: 343px;
  top: 79px;
  color: #696969;
`;
export const LinkedinIcon = styled.i`
  margin-right: 25.74px;
  height: 12.95px;
  width: 12.87px;
`;
export const TwitterIcon = styled.i`
  margin-right: 25.74px;
  height: 12.87px;
  width: 16.09px;
`;
export const FacebookIcon = styled.i`
  margin-right: 25.74px;
  height: 16.09px;
  width: 8.36px;
`;
export const PinterestIcon = styled.i`
  height: 14.78px;
  width: 12.23px;
`;
